import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { LancamentoCadastroComponent } from './lancamento-cadastro/lancamento-cadastro.component';
import { LancamentosPesquisaComponent } from './lancamentos-pesquisa/lancamentos-pesquisa.component';
import { LancamentosGridComponent } from './lancamentos-grid/lancamentos-grid.component';
import { FormsModule } from '@angular/forms';
import { InputTextModule } from 'primeng/inputtext/inputtext';
import { ButtonModule } from 'primeng/button/button';
import { TooltipModule } from 'primeng/tooltip/tooltip';
import { InputTextareaModule } from 'primeng/inputtextarea/inputtextarea';
import { CalendarModule } from 'primeng/calendar/calendar';
import { SelectButtonModule } from 'primeng/selectbutton/selectbutton';
import { DropdownModule } from 'primeng/dropdown/dropdown';
import { InputMaskModule } from 'primeng/inputmask/inputmask';
import { TableModule } from 'primeng/table/table';
import { TabViewModule } from 'primeng/tabview/tabview';
import { InputNumberModule } from 'primeng/inputnumber/inputnumber';
import { MessageComponent } from '../message/message.component';



@NgModule({
  imports: [
    CommonModule,
    FormsModule,
    InputTextModule,
    ButtonModule,
    TabViewModule,
    TableModule,
    TooltipModule,
    InputTextareaModule,
    CalendarModule,
    SelectButtonModule,
    DropdownModule,
    InputNumberModule,
    InputMaskModule
  ],
  declarations: [
    LancamentoCadastroComponent,
    LancamentosPesquisaComponent,
    LancamentosGridComponent
  ],
  exports: [
    LancamentoCadastroComponent,
    LancamentosPesquisaComponent
  ]
})
export class LancamentosModule { }
